// AddCar.js
import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './AddCar.css';

function AddCar() {
    const [modelo, setModelo] = useState('');
    const [marca, setMarca] = useState('');
    const [ano, setAno] = useState('');
    const [categoria, setCategoria] = useState('');
    const [disponibilidade, setDisponibilidade] = useState(true);
    const [arquivo, setArquivo] = useState('');
    const navigate = useNavigate();

    const handleSubmit = (e) => {
        e.preventDefault();
        const newCar = { modelo, marca, ano, categoria, disponibilidade,arquivo };

        fetch('http://localhost:25000/data', {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json',
            },
            body: JSON.stringify(newCar),
        })
            .then(response => {
                if (response.ok) {
                    navigate('/'); // Volta para a lista de carros
                } else {
                    console.error("Erro ao adicionar carro:", response.statusText);
                }
            })
            .catch(error => console.error("Erro ao adicionar carro:", error));
    };
    const handleAdd = () => {
        navigate('/');
    };

    return (
        <div class="container">
            <div class="text">
                Adicionar Carro
            </div>
            <form action="#">
                <div class="form-row">
                    <div class="input-data">
                        <input type="text" value={modelo} onChange={(e) => setModelo(e.target.value)} required />
                        <div class="underline"></div>
                        <label for="">Modelo</label>
                    </div>
                    <div class="input-data">
                        <input type="text" value={marca} onChange={(e) => setMarca(e.target.value)} required />
                        <div class="underline"></div>
                        <label for="">Marca</label>
                    </div>
                </div>
                <div class="form-row">
                    <div class="input-data">
                        <input type="number" value={ano} onChange={(e) => setAno(e.target.value)} required />
                        <div class="underline"></div>
                        <label for="">Ano de Fabricação</label>
                    </div>
                    <div class="input-data">
                        <input type="text" value={categoria} onChange={(e) => setCategoria(e.target.value)} required />
                        <div class="underline"></div>
                        <label for="">Carroceria</label>
                    </div>
                </div>
                <div class="form-row">
                    <div class="input-data">
                        <input type="file" value={arquivo} onChange={(e) => setArquivo(e.target.value)} required />
                        <div class="underline"></div>
                    </div>
                </div>
                <div class="form-row">
                    <div class="input-data textarea">
                         <label for="">Disponibilidade</label>
                    </div>
                    <input class="checkbox" type="checkbox" checked={disponibilidade} onChange={() => setDisponibilidade(!disponibilidade)}/>
                </div>

                <div class="form-row submit-btn">
                    <div class="input-data">
                        <div class="inner"></div>
                        <input type="submit" value="Adicionar" onClick={handleSubmit} />
                    </div>
                    <div class="input-data">
                        <div class="inner"></div>
                        <input type="button" value="Voltar" onClick={handleAdd} />
                    </div>
                </div>

            </form>
        </div>
    );
}

export default AddCar;
